import { DataBL } from "./BuinessLogic/QualificationBL";
import * as QualificationTemplate from "./Template/QualificationTemplate";

var dataSource = 
new kendo.data.DataSource({
    pageSize: 6,
    transport: {
        read: async (ev) => { 
            let result = await DataBL.readData();
            ev.success(result);
        },
        create: async (ev) => {
            await DataBL.createData(ev.data);
            dataSource.read();
        },
        update: async (ev) => {
           await DataBL.updateData(ev.data);
           dataSource.read();
        },
        destroy: async (ev) => {
            await DataBL.destroyData(ev.data);
            dataSource.read();
        }
    },
    schema: {
        model: {
            id: "Id",
            fields: {
                Title: { type: "string" },
            }
        }
    },
});

const grid = $("#gridQualification").kendoGrid({
    columns: [
        { field: "Title", title: "Initiative ID" },
    ],
    editable: {
       mode: "popup",
       template: QualificationTemplate.getTemplate(),
       window: { title: "Rating" }
   },
    autoBind: true,
    toolbar: [{
        name: "create",
        text: "ADD NEW"
    }],
    dataSource: dataSource,
}).data("kendoGrid");
